INSERT INTO `evalution_creterias` (`id`, `evaluation_category_id`, `percent`, `name`, `created_at`, `updated_at`) VALUES
(1, 1, 10, 'በመንግስት ፖሊሲዎችና ስትራተጂዎች ዪንቨርስቲዎች ያለው/ያላት ግንዛቤ', '2023-03-27 23:17:46', '2023-03-28 00:06:22'),
(2, 1, 15, 'በስራ ላይ የሚያሳየው የምታሳየው  ትብብር', '2023-03-27 23:18:34', '2023-03-28 00:09:11'),
(3, 7, 5, 'በስራ ተነሳሽነት አዳዲስ ሃሳቦችንና አሰራር ዘዴዎችን ለማመንጨት የተደረገው ጥረት', '2023-03-27 23:20:07', '2023-03-27 23:20:07'),
(4, 7, 5, 'የበላይ አመራር ሳይጠይቁ የመስራት ልምድ', '2023-03-27 23:20:57', '2023-03-27 23:20:57'),
(5, 7, 5, 'የስራን ችሎታ በየጊዜው ለማሻሻል የተደረገ ጥረት', '2023-03-27 23:21:55', '2023-03-27 23:21:55'),
(6, 6, 5, 'ሀላፊዎችና ከስራ ባልደረቦቼ ጋር ያለው/ያላት ትብብርና መግባባት', '2023-03-27 23:30:29', '2023-03-28 00:16:02'),
(7, 6, 5, 'በቡድን ስራ ላይ የሚያሳየው ትብብር', '2023-03-27 23:31:40', '2023-03-27 23:31:40'),
(8, 6, 5, 'የምክርና ገንቢ ሃሳብ ለመቀበል የሚያሳየው/የምታሳየው አንደኝነት', '2023-03-27 23:33:04', '2023-03-27 23:33:04'),
(9, 1, 10, 'ሃላፊነት በአግባቡ መወጣት', '2023-03-27 23:34:22', '2023-03-27 23:34:22'),
(10, 8, 5, 'በችሎታው የመተማመን ዝንባሌ', '2023-03-27 23:36:08', '2023-03-27 23:36:08'),
(11, 8, 5, 'በሃላፊነት መጠን አውቆ ራስን በራስ በመቆጣጠር የመስራት ባህል', '2023-03-27 23:36:54', '2023-03-27 23:36:54'),
(12, 2, 4, 'በተቃሚዋ የለውጥ እንቅስቃሴ ውስጥ የሚኖር ተሳትፎና ስተዋጽኦ', '2023-03-27 23:38:20', '2023-03-27 23:38:20'),
(13, 2, 3, 'ተለዋዋጭ ሁኔታዎችን ተቀብሎ የማስተናገድ ብቃት', '2023-03-27 23:39:36', '2023-03-27 23:39:36'),
(14, 2, 3, 'ያለመግባባት ወይም ያልተለመዱ ሁኔታዎች ሲያጋጥሙ የመቋቋም ችሎታ', '2023-03-27 23:44:48', '2023-03-27 23:44:48'),
(15, 3, 8, 'በተወሰነ ጊዜ ውስጥ ባለሙያው የተከናወነ የስራው ውጤት መጠን', '2023-03-27 23:45:48', '2023-03-27 23:45:48'),
(16, 3, 7, 'የተከናወነ የስራ መጠን ሌሎች የስራ ባልደረቦች ካከናወኑ አንፃር ሲመዘን', '2023-03-27 23:46:30', '2023-03-27 23:46:30'),
(17, 4, 5, 'የስራ በትክክልና በጥናት ለማከናወን ያለው/ያላት ችሎታ', '2023-03-27 23:48:25', '2023-03-27 23:48:25'),
(18, 4, 5, 'በተፈለገው ወቅት እና ቅደም ተከተል ስራን ለማጠናቀቅ የሚያሳየው/የምታሳየው ትጋት', '2023-03-27 23:49:17', '2023-03-27 23:49:17'),
(19, 5, 3, 'አዘውትሮ ሸራ ላይ መገኘትና የስራ ሰአትን በመስሪያቤቱ ስራ ብቻ የመዋል ልምድ', '2023-03-27 23:51:26', '2023-03-27 23:51:26'),
(20, 5, 3, 'በመስሪያ ቤቱ ውስጥ አስነዋሪ ጠባይ አለማሳየት የግል ንጽህና ለመጠበቅ የሚያደርገውን የምታደርገው ጥንቃቄ', '2023-03-27 23:53:50', '2023-03-27 23:53:50'),
(21, 5, 3, 'ለስራው እና ለመስሪያ ቤቱ ያለው /ያላት ተቆርቋሪነት', '2023-03-27 23:54:49', '2023-03-27 23:54:49'),
(22, 5, 3, 'ለተገልጋይ ያላት/ያለው አክብሮትና መስተንግዶ', '2023-03-27 23:55:27', '2023-03-27 23:55:27'),
(23, 5, 3, 'ሙስና እና ብልሹ አሰራርን የመግባባት አቅም', '2023-03-27 23:57:09', '2023-03-27 23:57:09'),
(24, 1, 15, 'የስራ ተነሳሽነት', '2023-03-28 00:11:50', '2023-03-28 00:11:50');
