(1, 2, '<p>የጅማ ዩኒቨርሲቲ %unit% %posotion% የሥራ መደብ %employementType% ለመቅጠር በቀን %vacancyDate% ዓ/ም ባወጣው ማስታወቂያ መሠረት ተመዝግበው %examDate% ዓ.ም. በተሠጠው የጹሑፍ ፈተና እና በ %interviewDate% ዓ.ም. የተግባር ፈተና ወስደው እርስዎ ከተወዳዳሪዎች መካከል %totalmark% % ውጤት በማምጣት በ %employementType% እንዲቀጠሩ ተወስኗል፡፡</p>\n<p>በዚሁ መሰረት በደረጃ %jobLevel% በመደብ መታወቂያ ቁጥር %jobCode% በ %unit% በ%position% የሥራ መደብ ለስድስት ወር የሙከራ ጊዜ የተቀጠሩ መሆኑን እያስታወቅን በዚህ ጊዜ ውስጥ የተጣለብዎትን የስራ ኃላፊነት በትጋትና በታማኝነት እንዲወጡ እያሳሰብን ለሥራ መደቡ የተፈቀደው የወር ደመወዝ ብር %salary% /ሦስት ሺህ ዘጠኝ መቶ ሰላሳ አራት ብር/ እየተከፈልዎት እንዲሠሩ ተፈቅዷል::</p>\n<p>የክፍያና ሂሳብ አስተዳደር ዳይሬክቶሬትም ከ %hireDate% ዓ.ም. ጀምሮ ደመወዝዎን ከገንዘብና የኢኮኖሚ ልማት ትብብር ሚኒስቴር እየጠየቀ በማምጣት እንዲከፍልዎ በዚህ ደብዳቤ ግልባጭ እናሳስባለን፡፡</p>\n<ul>\n\n', '2023-04-01 08:27:05', '2023-04-02 15:49:34');
