























































































































CREATE TABLE `promotions` (
  `id` bigint UNSIGNED NOT NULL,
  `employee_id` bigint UNSIGNED NOT NULL,
  `old_unit_id` bigint UNSIGNED NOT NULL,
  `new_unit_id` bigint UNSIGNED NOT NULL,
  `old_job_title_id` bigint UNSIGNED NOT NULL,
  `new_job_title_id` bigint UNSIGNED NOT NULL,
  `created_by_id` bigint UNSIGNED NOT NULL,
  `reason_of_promotion` text COLLATE utf8mb4_unicode_ci,
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;



































